import React from 'react';

class Form extends React.Component {
    render() {
      return (
        <form onSubmit={this.props.handleFormSubmit}> 
            <input type="text" id="session" placeholder="Session" value={this.props.newSession} onChange={this.props.handleInputChange} />
            <input type="text" id="timeslot" placeholder="Time Slot" value={this.props.newTimeslot} onChange={this.props.handleInputChange} />
            <input type="text" id="speaker" placeholder="Speaker" value={this.props.newSpeaker} onChange={this.props.handleInputChange} />
            <input type="text" id="room" placeholder="Room" value={this.props.newRoom} onChange={this.props.handleInputChange} />
            <input type="text" id="action" placeholder="Action" value={this.props.newAction} onChange={this.props.handleInputChange} />
            <input type="button" class="add-row" value="Add Row" />
        </form>
      );
    }
  }

  export default Form;
